#include "misc.h"

Misc::Misc(unsigned int MAX_PLAYERS, unsigned int LAN_MODE) {
	this->MAX_PLAYERS = MAX_PLAYERS;
	this->LAN_MODE = LAN_MODE;
}

Misc::~Misc() {
	
}

void Misc::radar() {
	if (LAN_MODE == 0) {
		if (GetAsyncKeyState(KEY_RADAR) & 1)
			radarToggle = !radarToggle;

		if (!radarToggle)
			return;

		for (int i = 1; i < MAX_PLAYERS; i++) {
			unsigned int e = pEntity->getEntity(i);
			bool dormant = pEntity->isDormant(e);
			unsigned int entityTeam = pEntity->getTeam(e);
			unsigned int myTeam = pLocal->getTeam();

			if (!dormant) {
				if (entityTeam != myTeam) {
					m->WriteMem<int>(e + offsets::m_bSpotted, true);
				}
			}
		}
	} else {
		if (GetAsyncKeyState(KEY_RADAR_HOLD)) {
			for (int i = 1; i < MAX_PLAYERS; i++) {
				unsigned int e = pEntity->getEntity(i);
				bool dormant = pEntity->isDormant(e);
				unsigned int entityTeam = pEntity->getTeam(e);
				unsigned int myTeam = pLocal->getTeam();

				if (!dormant) {
					if (entityTeam != myTeam) {
						m->WriteMem<int>(e + offsets::m_bSpotted, true);
					}
				}
			}
		}
	}
}

void Misc::bhop() {
	if (GetAsyncKeyState(KEY_BHOP) & 1)
		bhopToggle = !bhopToggle;

	if (!bhopToggle)
		return;

	unsigned int flag = pLocal->getFlags();

	if (GetAsyncKeyState(VK_SPACE)) {
		if (pLocal->isMoving()) {
			if (flag == 257 || flag == 263) {
				m->WriteMem<int>(m->cDll.dwBase + offsets::dwForceJump, 6);
			}
		}
	}
}

